BEGIN TRANSACTION;
CREATE TABLE "accounts_user" ("password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_staff" bool NOT NULL, "user_id" varchar(50) NOT NULL PRIMARY KEY, "first_name" varchar(50) NOT NULL, "last_name" varchar(50) NOT NULL, "username" varchar(50) NOT NULL UNIQUE, "email" varchar(50) NOT NULL UNIQUE, "user_address" varchar(50) NOT NULL, "date_joined" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "is_active" bool NOT NULL, "is_superuser" bool NOT NULL, "role_name" varchar(50) NOT NULL, "phone_number" varchar(50) NOT NULL);
CREATE TABLE "accounts_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" varchar(50) NOT NULL REFERENCES "accounts_user" ("user_id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "accounts_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" varchar(50) NOT NULL REFERENCES "accounts_user" ("user_id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "accounts_user_client" ("user_ptr_id" varchar(50) NOT NULL PRIMARY KEY REFERENCES "accounts_user" ("user_id") DEFERRABLE INITIALLY DEFERRED, "client_id" varchar(50) NOT NULL REFERENCES "accounts_client" ("client_id") DEFERRABLE INITIALLY DEFERRED, "client_user_manager" varchar(50) NOT NULL, "is_client_admin" bool NOT NULL, "is_system_integrator" bool NOT NULL);
CREATE TABLE "accounts_user_si" ("user_ptr_id" varchar(50) NOT NULL PRIMARY KEY REFERENCES "accounts_user" ("user_id") DEFERRABLE INITIALLY DEFERRED, "si_id" varchar(50) NOT NULL REFERENCES "accounts_si" ("client_ptr_id") DEFERRABLE INITIALLY DEFERRED, "is_system_integrator" bool NOT NULL);
CREATE TABLE "accounts_client" ("client_id" varchar(50) NOT NULL PRIMARY KEY, "client_name" varchar(50) NOT NULL, "client_license_key" varchar(100) NOT NULL, "client_role" varchar(50) NOT NULL, "assigned_to" varchar(50) NOT NULL, "client_address" varchar(500) NOT NULL, "is_deleted" bool NOT NULL);
CREATE TABLE "accounts_si" ("client_ptr_id" varchar(50) NOT NULL PRIMARY KEY REFERENCES "accounts_client" ("client_id") DEFERRABLE INITIALLY DEFERRED, "activeClients" varchar(200) NOT NULL, "license_key_list" varchar(200) NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" varchar(50) NOT NULL REFERENCES "accounts_user" ("user_id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
